
 function measureTextWidth(text:string) {
    const tempElement: HTMLElement = document.createElement('div');;
    tempElement.style.position = 'absolute';
    tempElement.style.visibility = 'hidden';
    tempElement.style.whiteSpace = 'nowrap';
    tempElement.textContent = text;
    document.body.appendChild(tempElement);
    const width = tempElement.scrollWidth;
    document.body.removeChild(tempElement);
    return width;
}
function measureTextHeight(text:string) {
    const tempElement = document.createElement('div');
    tempElement.style.position = 'absolute';
    tempElement.style.visibility = 'hidden';
    tempElement.style.whiteSpace = 'nowrap';
    tempElement.textContent = text;
    document.body.appendChild(tempElement);
    const height = tempElement.clientHeight;
    document.body.removeChild(tempElement);
    return height;
}
function resizeImage(height: number, width: number, img: any,maxWidth:number,maxHeight:number): string {
    let newWidth = width;
    let newHeight = height;
  
    if (width > maxWidth) {
      newHeight *= maxWidth / width;
      newWidth = maxWidth;
    }

    if (newHeight > maxHeight) {
      newWidth *= maxHeight / newHeight;
      newHeight = maxHeight;
    }

    const canvas: HTMLCanvasElement = document.createElement("canvas");
    const ctx: CanvasRenderingContext2D | null = canvas.getContext("2d");

    canvas.width = newWidth;
    canvas.height = newHeight;

    if (ctx) {
      ctx.drawImage(img, 0, 0, newWidth, newHeight);
      return canvas.toDataURL("image/png");
    }
    return "";
}
